        <style jsx>{`
            h1{
                color:red;
            }

            img{
                max-width:50%;
                margin: 0 auto;
            }

        `}</style>

        <style jsx global>
            {`
            body{
                background:teal;
            }
            `}
        </style>
    </>
)

